import React from 'react'
import { Outlet, Route, Routes } from 'react-router-dom';
import About from './About';
import Service from './Service';
import Body from './Body'
import Nav from './Nav'
import User from './User'
const Home=(props)=>{
    return (<>
    <div style={{backgroundColor:"royalblue "}}>
                This is {props.ele} page
            </div>

    </>);
}

const App=()=>{

    return(
        <>

        <Nav/>
        <Routes>
            <Route path="/" element={(<>
            <Outlet/>
            </>)}>
                <Route path='/Home' element={<Home ele="Home"/>}/>
                <Route path='/About' element={<Home ele="About"/>}/>
                <Route path='/Service' element={<Home ele="Service"/>}/>
                <Route path='/Body' element={<Home ele="Body"/>}/>
                <Route path='/User/:name' element={<User/>}/>
                <Route path='*' element={
                    <>
                        <div style={{backgroundColor:"red"}}>
                            <h3>opps page not found</h3>
                        </div>
                    </>
                }/>

            </Route>
        </Routes>
        </>
    )
}

export default App;
